CREATE DATABASE Superstore_DB
USE Superstore_DB

CREATE TABLE Customer_Name(
	Customer_name VARCHAR(50),
	Order_ID INT PRIMARY KEY NOT NULL);

CREATE TABLE Orders (
	Row_ID INT,
	Order_ID INT,
	Order_Date DATE,
	Order_Priority VARCHAR(20),
	Order_Quantity INT,
	Sales FLOAT,
	Discount FLOAT,
	Ship_Mode VARCHAR(20),
	Profit FLOAT,	
	Unit_Price FLOAT,
	Shipping_Cost FLOAT,
	Customer_Name	VARCHAR(50),
	Province VARCHAR(50),
	Region	VARCHAR(50),
	Customer_Segment VARCHAR(50),
	Product_Category	VARCHAR(50),
	Product_SubCategory VARCHAR(50),
	Product_Name VARCHAR(250),
	Product_Container VARCHAR(50),
	Product_Base_Margin	FLOAT NULL,
	Ship_Date DATE
FOREIGN KEY (Order_ID) REFERENCES Customer_Name(Order_ID));



CREATE TABLE Users ( 
	Region VARCHAR (20),
	Manager VARCHAR(20));

CREATE TABLE Returns(
	Order_ID INT,
	Status VARCHAR (20)
FOREIGN KEY (Order_ID) REFERENCES Customer_Name(Order_ID));






