--1. Display the total sales by region
SELECT Region, SUM(Sales) AS Total_Sales
FROM Orders
GROUP BY Region;

--2. Display the top 5 products by total profit
SELECT TOP 5 Product_Name, SUM(Profit) AS Total_Profit
FROM Orders
GROUP BY Product_Name
ORDER BY Total_Profit DESC

--3. Display the customer with the highest total sales
SELECT TOP 1 Customer_Name, SUM(Sales) AS Total_Sales
FROM Orders
GROUP BY Customer_Name
ORDER BY Total_Sales DESC

--4. Display the average discount by category
SELECT Product_Category, AVG(Discount) AS Average_Discount
FROM Orders
GROUP BY Product_Category;


---TO CHECK FOR DUPLICATES----
SELECT *, 
ROW_NUMBER()OVER(PARTITION BY Row_ID, Order_ID, Order_Date,	Order_Priority,	Order_Quantity,	Sales,	Discount, Ship_Mode, Profit, Unit_Price, Shipping_Cost,	Customer_Name,	Province,	Region,	Customer_Segment,	Product_Category,	Product_SubCategory,	Product_Name,	Product_Container,	Product_Base_Margin,	Ship_Date ORDER BY Order_ID) AS RowNum
FROM Orders

WITH Duplicates_CTEs AS (SELECT *, 
ROW_NUMBER()OVER(PARTITION BY Row_ID, Order_ID, Order_Date,	Order_Priority,	Order_Quantity,	Sales,	Discount, Ship_Mode, Profit, Unit_Price, Shipping_Cost,	Customer_Name,	Province,	Region,	Customer_Segment,	Product_Category,	Product_SubCategory,	Product_Name,	Product_Container,	Product_Base_Margin,	Ship_Date ORDER BY Order_ID) AS RowNum
FROM Orders)
SELECT * 
FROM Duplicates_CTEs
WHERE RowNum > 1;

---- TO CHECK FOR MISSING VALUES----
SELECT 
COUNT(*)  AS TOTAL_ROW,
SUM (CASE WHEN Row_ID IS NULL THEN 1 ELSE 0 END)AS Missing_column1,
SUM (CASE WHEN Order_ID IS NULL THEN 1 ELSE 0 END)AS Missing_column2,
SUM (CASE WHEN Order_Date IS NULL THEN 1 ELSE 0 END)AS Missing_column3,
SUM (CASE WHEN Order_Priority IS NULL THEN 1 ELSE 0 END)AS Missing_column4,
SUM (CASE WHEN Sales IS NULL THEN 1 ELSE 0 END)AS Missing_column5,
SUM (CASE WHEN Discount IS NULL THEN 1 ELSE 0 END)AS Missing_column6,
SUM (CASE WHEN Ship_mode IS NULL THEN 1 ELSE 0 END)AS Missing_column7,
SUM (CASE WHEN Profit IS NULL THEN 1 ELSE 0 END)AS Missing_column8,
SUM (CASE WHEN  Unit_Price IS NULL THEN 1 ELSE 0 END)AS Missing_column9,
SUM (CASE WHEN Shipping_Cost IS NULL THEN 1 ELSE 0 END)AS Missing_column10,
SUM (CASE WHEN Customer_Name IS NULL THEN 1 ELSE 0 END)AS Missing_column11,
SUM (CASE WHEN Order_Quantity IS NULL THEN 1 ELSE 0 END)AS Missing_column12,
SUM (CASE WHEN Province IS NULL THEN 1 ELSE 0 END)AS Missing_column13,
